INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 122601, 101, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 110, 1, 1.5, 105, 0, 1, 0, 0.029, 1, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 122401, 102, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 105, 2, 2.5, 111, 1, 3, 0, 0.014, 2, 120);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 122501, 103, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 110, 3, 2.5, 105, 0, 2, 1, 0.017, 3, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 107501, 104, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 110, 4, 1.5, 105, 1, 3, 0, 0.016, 4, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 107601, 105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 110, 5, 2.5, 105, 0, 1, 0, 0.014, 5, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 107801, 106, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 120, 6, 3.5, 103, 0, 2, 1, 0.029, 6, 255);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 110601, 107, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 120, 7, 3.5, 103, 0, 1, 0, 0.013, 7, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 110401, 108, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110, 8, 2.5, 103, 0, 2, 1, 0.014, 8, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 110501, 109, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 105, 9, 1.5, 100, 1, 3, 0, 0.012, 9, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 115701, 110, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 105, 10, 2.5, 103, 0, 1, 0, 0.014, 10, 200);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113601, 111, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 105, 11, 2.5, 103, 0, 2, 1, 0.071, 11, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 107901, 112, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 120, 12, 1.5, 103, 1, 3, 0, 0.014, 12, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 108001, 113, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 110, 13, 1.5, 105, 0, 2, 0, 0.022, 13, 200);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 110301, 114, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110, 14, 2.5, 108, 0, 1, 0, 0.031, 14, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 107701, 115, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 110, 15, 0.5, 105, 1, 1, 0, 0.036, 15, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113101, 116, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 110, 16, 3.5, 95, 0, 2, 1, 0.048, 16, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113301, 117, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 17, 1.5, 105, 1, 3, 0, 0.043, 17, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113201, 118, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 105, 18, 1.5, 95, 1, 2, 0, 0.018, 18, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 117001, 119, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 110, 19, 2.5, 108, 0, 2, 0, 0.021, 19, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113501, 120, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 110, 20, 2.5, 105, 0, 1, 1, 0.036, 20, 255);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 113401, 121, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 21, 2.5, 105, 0, 3, 1, 0.02, 21, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 110101, 122, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110, 22, 2.5, 105, 1, 1, 0, 0.018, 22, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 110001, 123, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 105, 23, 3.5, 111, 0, 3, 0, 0.03, 23, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 117201, 124, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 110, 24, 1.5, 103, 1, 1, 0, 0.027, 24, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 117301, 125, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 105, 25, 3.5, 108, 0, 2, 0, 0.02, 25, 160);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 117401, 126, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 110, 26, 2.5, 105, 0, 3, 1, 0.04, 26, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 117101, 127, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 110, 27, 3.5, 105, 0, 1, 1, 0.009, 27, 350);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 122901, 128, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 120, 28, 3.5, 105, 0, 1, 1, 0.022, 28, 255);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0, 122801, 129, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 110, 29, 2.5, 105, 1, 3, 0, 0.028, 29, 130);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (1, 122701, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 105, 30, 3.5, 108, 0, 2, 0, 0.023, 30, 130);
